§ 2

Użyte w Regulaminie określenia oznaczają:
1) BON – Biuro ds. Osób Niepełnosprawnych;
2) dziekanat – miejsce obsługi administracyjnej studentów;
3) efekty uczenia się – wiedza, umiejętności oraz kompetencje społeczne nabyte w procesie uczenia się;
4) forma studiów – studia stacjonarne lub studia niestacjonarne;
5) forma zajęć – sposób realizacji zajęć oraz nabywania efektów uczenia się, tj.: wykłady, ćwiczenia, laboratoria, projekty oraz praktyki zawodowe;
6) IOS (indywidualna organizacja studiów) – spersonalizowany tryb organizacji zajęć przyznawany studentowi w uzasadnionych przypadkach, obejmujący możliwość modyfikacji metod i form kształcenia, z jednoczesnym zachowaniem przyjętych dla danego kierunku studiów efektów uczenia się;
7) karta opisu przedmiotu – dokument stanowiący opis zajęć realizowanych zgodnie z programem studiów, zawierający: liczbę godzin zajęć i punkty ECTS, wykaz osób odpowiedzialnych za przedmiot, cel przedmiotu, opis przedmiotowych efektów uczenia się oraz metody ich weryfikacji i kryteria oceny, a także treści programowe, metody dydaktyczne, literaturę i bilans nakładu pracy;
8) kierunek studiów – obszar kształcenia przyporządkowany do jednej lub kilku dyscyplin naukowych, realizowany w Uczelni w sposób określony przez program studiów;
9) plan studiów – część programu studiów, w której określono zajęcia lub grupy zajęć, ich wymiar godzinowy, formy i liczby punktów ECTS, z podziałem na poszczególne semestry;
10) potwierdzanie efektów uczenia się – formalny proces weryfikacji posiadanych efektów uczenia się uzyskanych w procesie uczenia się poza systemem studiów;
11) poziom studiów – studia pierwszego stopnia lub studia drugiego stopnia;
12) profil studiów – profil ogólnoakademicki (ponad połowa punktów ECTS jest przypisana zajęciom związanym z prowadzoną w uczelni działalnością naukową) lub profil praktyczny (ponad połowa punktów ECTS jest przypisana zajęciom kształtującym umiejętności praktyczne);
13) program studiów – opis określonych przez Uczelnię spójnych efektów uczenia się oraz opis procesu uczenia się, prowadzącego do osiągnięcia tych efektów wraz z przypisanymi do poszczególnych zajęć punktami ECTS;
14) punkty ECTS (European Credit Transfer and Accumulation System) – punkty zdefiniowane w europejskim systemie akumulacji i transferu punktów zaliczeniowych będące miarą średniego nakładu pracy studenta, niezbędnego do uzyskania zakładanych efektów uczenia się;
15) studia pierwszego stopnia – forma uczenia się, kończąca się uzyskaniem kwalifikacji pełnej na poziomie 6 Polskiej Ramy Kwalifikacji;

