17) studia stacjonarne – forma studiów wyższych, w której co najmniej połowa punktów ECTS objętych programem studiów jest uzyskiwana w ramach zajęć z bezpośrednim udziałem nauczycieli akademickich lub innych osób prowadzących zajęcia i studentów;
18) studia niestacjonarne – forma studiów wyższych, w której mniej niż połowa punktów ECTS objętych programem studiów może być uzyskiwana z bezpośrednim udziałem nauczycieli akademickich lub innych osób prowadzących zajęcia i studentów;
19) Uczelnia – Politechnika Poznańska;
20) Ustawa – Ustawa z dnia 20 lipca 2018 r. Prawo o szkolnictwie wyższym i nauce;
21) wydział – podstawowa jednostka organizacyjna Uczelni, której zadaniem jest prowadzenie działalności badawczej i dydaktycznej oraz kształcenie kadry naukowej w co najmniej jednej dyscyplinie;
22) zajęcia lub grupy zajęć – przedmiot lub blok przedmiotów, zajęcia terenowe lub praktyki zawodowe;
23) ZCO (Zintegrowane Centrum Obsługi) – miejsce obsługi administracyjnej studentów.

§ 5

1. Student, po złożeniu egzaminu dyplomowego z wynikiem pozytywnym, otrzymuje dyplom ukończenia studiów pierwszego lub drugiego stopnia.

2. Uczelnia wydając dyplomy ukończenia studiów, nadaje następujące tytuły zawodowe:
   1) licencjata;
   2) inżyniera;

