2) zrzeszania się w kołach naukowych oraz uczestniczenia w pracach naukowych, rozwo-
   jowych i wdrożeniowych, na zasadach przyjętych w Uczelni;
3) zrzeszania się w organizacjach na zasadach określonych w Ustawie;
4) rozwijania zainteresowań kulturalnych, turystycznych i sportowych, korzystania w tym
   celu z urządzeń i środków Uczelni oraz pomocy nauczycieli akademickich i władz
   Uczelni, na zasadach regulujących prowadzenie tej działalności przez właściwe organi-
   zacje;
5) przenoszenia i uznawania zaliczonych zajęć wraz z punktami ECTS;
6) usprawiedliwiania nieobecności na zajęciach;
7) urlopów od zajęć oraz urlopów od zajęć z możliwością przystąpienia do weryfikacji uzy-
   skanych efektów uczenia się określonych w programie studiów;
8) zmiany kierunku studiów;
9) przeniesienia na studia stacjonarne albo niestacjonarne;
10) wglądu do swojej ocenionej pracy pisemnej w ciągu 14 dni od udostępnienia wyniku;
11) przystąpienia do egzaminu komisyjnego przy udziale wskazanego przez niego obser-
    watora;
12) powtarzania określonych zajęć z powodu niezadowalających wyników w nauce;
13) uzyskiwania nagród i wyróżnień;
14) otrzymywania świadczeń na zasadach określonych odrębnymi przepisami;
15) odbywania studiów według indywidualnej organizacji studiów na zasadach określonych
    przez dziekana;
16) udziału w wykładach prowadzonych w Uczelni, a za zgodą prowadzącego i dziekana –
    w pozostałych formach zajęć;
17) czynnego uczestniczenia w procedurze oceny procesu uczenia się;
18) pomocy psychologicznej;
19) udziału w szkoleniu z zakresu praw i obowiązków studenta; szkolenia prowadzi Samo-
    rząd Studentów Uczelni we współpracy z Parlamentem Studentów Rzeczypospolitej
    Polskiej.

B. Obowiązki studenta

2. Student jest zobowiązany do:
1) postępowania zgodnego z treścią złożonego ślubowania;
2) podpisania oświadczenia, że zapoznał się z zasadami pobierania opłat i zobowiązuje się
   ich przestrzegać;
3) udziału we wszystkich obowiązkowych zajęciach przewidzianych w planie studiów oraz ter-
   minowego spełniania innych wymagań przewidzianych w programie studiów i Regulami-
   nie;
4) zapoznania się z przepisami bezpieczeństwa i higieny pracy obowiązującymi w laborato-
   riach, w których odbywają się zajęcia przewidziane w programie studiów;
5) zapewnienia zasobów niezbędnych do pełnego uczestniczenia w zajęciach, zgodnie z za-
   łożeniami przyjętymi w kartach opisu przedmiotu;
6) usprawiedliwienia u prowadzącego nieobecności na zajęciach, niezwłocznie po ustaniu
   przyczyny nieobecności;
7) niezwłocznego zawiadomienia dziekanatu lub ZCO o zmianie danych osobowych;
8) złożenia dziekanowi oświadczenia o rezygnacji w przypadku odstąpienia od kontynuowa-
   nia studiów;
9) kontrolowania kompletności wpisu uzyskanych zaliczeń w systemie elektronicznym.
