2) stwierdzenia braku postępów w nauce;
3) nieuzyskania zaliczenia semestru w określonym terminie;
4) niewniesienia opłat związanych z odbywaniem studiów.

3. Rektor stwierdza:
   1) niepodjęcie studiów – w przypadku niezłożenia ślubowania w okresie 1/3 semestru od jego rozpoczęcia;
   2) brak postępów w nauce – na podstawie § 18 ust. 3 oraz § 20 ust. 1;
   3) brak udziału w obowiązkowych zajęciach – w przypadku nieobecności przekraczającej 30% zajęć w planie studiów;
   i podejmuje stosowne decyzje.

§ 32

1. Warunkiem dopuszczenia do egzaminu dyplomowego jest:
   1) uzyskanie liczby punktów ECTS potwierdzających osiągnięcie efektów uczenia się przewidzianych w programie studiów oraz zaliczenie wszystkich wymaganych zajęć o charakterze informacyjnym;
   2) złożenie pracy dyplomowej, o której mowa w § 30 ust. 2 i 6;
   3) pozytywna opinia o pracy dyplomowej promotora, po uwzględnieniu obowiązku, o którym mowa w § 30 ust. 9;
   4) pozytywna opinia o pracy dyplomowej co najmniej jednego recenzenta;
   5) złożenie kompletu wymaganych dokumentów w dziekanacie lub ZCO przed planowaną datą obrony.

2. Egzamin dyplomowy odbywa się w terminie wyznaczonym przez dziekana, nie później niż 3 miesiące od dnia określonego w § 30 ust. 11; w przypadku przesunięcia terminu złożenia pracy, o którym mowa w § 30 ust. 12, egzamin powinien odbyć się w ciągu miesiąca od dnia złożenia pracy.
